■商品内容<br>
サイズ：約10ミリ前後　ホール：約1ミリ　<br>
※天然のため、サイズ、形に個体差がございます。<br>
カラー 　写真をご参考ください。<br>
素材：淡水パール<br>
数量：1連約37cm　　<br><br>
■スタッフより一言♪<br>
淡くやわらかな光が優しい淡水パールです。<br>ナチュラルでぽってりとしたかたちが、可愛らしく上品な印象です。<br>メタルチャームや他の天然石とも相性が良いので、ハンドメイドアクセサリーにぜひ取り入れたいアイテムです。<br>
<br>
※天然素材のため、色・形・大きさにばらつきがあり、表面にシワや若干の傷があるものが含まれます。予めご了承ください。<style type="text/css">
