■商品内容<br>
サイズ：約6*6*6mm　ホール　約1mm<br>
カラー 　写真をご参考ください。<br>
素材：ターコイズ(練り)<br>
数量：1連約39cm<br><br>
※完璧な立方体ではありません。<br><br>
■スタッフより一言♪<br>
独特のブルーグリーンをベースにブラウンの内包物の模様が雰囲気のあるターコイズビーズ。<br>メタルビーズとの相性も良く、そのさわやかな色合いは夏のアクセサリーにおすすめ。<br>
<br>
※連売りの為、粒によって画像4枚目のような大きさ・形のバラつきや、割れ・欠け等のある粒・天然由来および加工時に発生した傷・ヒビ・欠けなどが含まれている場合があります。
<br>予めご了承ください。<br>
<font color="FF66CC">※穴のサイズにより、ピン類が通らない場合がございます。<br>線径の細いものやワイヤーをお使いください。<br>無理に通そうとしますと破損いたしますので、ご注意ください。<br>
また、お手持ちのパーツやピン類が穴に通らない場合でも返品交換はいたしかねます。ご了承ください。<br><br>
